func initPoolSimulator() *PoolSimulator {
	var poolEntity entity.Pool
	err := json.Unmarshal([]byte(entityStr), &poolEntity)
	if err != nil {
		panic(err)
	}
	simulator, _ := NewPoolSimulator(poolEntity)
	return simulator
}

// Before optimized
// BenchmarkOptimizePoolSimulator-10    	    4090	    305928 ns/op	  338798 B/op	    8871 allocs/op
// After optimized
// BenchmarkOptimizePoolSimulator-10    	    7273	    162873 ns/op	  124083 B/op	    2937 allocs/op
func BenchmarkOptimizePoolSimulator(b *testing.B) {
	simulator := initPoolSimulator()
	amountIn, _ := new(big.Int).SetString("80000000000000000000", 10)
	params := pool.CalcAmountOutParams{
		TokenAmountIn: pool.TokenAmount{
			Token:  "0x912ce59144191c1204e64559fe8253a0e49e6548", // ARB
			Amount: amountIn,
		},
		TokenOut: "0x82af49447d8a07e3bd95bd0d56f35241523fbab1", // WETH
	}

	for i := 0; i < b.N; i++ {
		_, err := simulator.CalcAmountOut(params) // 17884738531015991 WETH
		assert.Nil(b, err)
	}
}

func TestOptimizeGetPriceFromIDWorkCorrectly(t *testing.T) {
	simulator := initPoolSimulator()

	for _, bin := range simulator.bins {
		priceBackup, errBackup := getPriceFromIDBackup(bin.ID, simulator.binStep)
		price, err := getPriceFromID(bin.ID, simulator.binStep)
		assert.Equal(t, priceBackup, price)
		assert.Equal(t, errBackup, err)
	}
}

